    let [state ,setstate]=useState({
        user:{
            username:'',
            email:'',
            password:''
    
        }
    })
    let updateInput=(e)=>{
        setstate({
            ...state,
            user:{
                ...state.user,
                [e.target.name]:e.target.value
            }
        })
    }
    const SubmitFunc=(e)=>{
        e.preventDefault()
        setstate({...state},e.target.value)

    }
    return(
        <>
            <Navbar bg='black' expand='sm' variant='light'>
                <Container>
                <Navbar.Brand style={{color:'white'}} href='/'>
