                   <Button>Cart</Button>
                </Navbar.Brand>
                </Container> 
            </Navbar>
            <Card style={{ height: '18rem' }}>
                <Card.Title>
                    <h1 style="font-size:10vw" align='center'>The Genriheightcs</h1>
                </Card.Title>
            </Card>
        </>

    )
}
